import React, { Component } from 'react';
import { Container, Row, Col } from 'react-bootstrap';

export default class TabBar extends Component {
  render() {
    return (
      <Container>
        <div className='navbar'>
          <Row>
            <Col-4><p>Upcomings events</p></Col-4>
            <Col-4><p>Friends</p></Col-4>
            <Col-4></Col-4>
          </Row>
        </div>



      </Container>
    )
  }
}
